import './../static/style/components/ad.css';
const Ad=()=>{
    return (
        <div className="ad-div comm-box">
            <div><img src="http://blogimages.jspang.com/flutter_ad2.jpg" alt="" width="100%"/></div>
            <div><img src="http://blogimages.jspang.com/Vue_koa_ad1.jpg" alt="" width="100%"/></div>
            <div><img src="http://blogimages.jspang.com/WechatIMG12.jpeg" alt="" width="100%"/></div>
        </div>
    )
}
export default Ad;
